import React, { useState } from 'react';
import { AppBar, Toolbar, Typography, Button, IconButton, Box, Drawer, List, ListItem, ListItemText, useMediaQuery, useTheme } from '@mui/material';
import { styled } from '@mui/material/styles';
import MenuIcon from '@mui/icons-material/Menu';
import { Link as RouterLink } from 'react-router-dom';
import YouTubeIcon from '@mui/icons-material/YouTube';

const StyledAppBar = styled(AppBar)(({ theme }) => ({
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.8) 0%, rgba(22, 33, 62, 0.8) 100%)',
  boxShadow: '0 8px 32px 0 rgba(0, 0, 0, 0.37)',
  backdropFilter: 'blur(10px)',
  borderBottom: '1px solid rgba(255, 255, 255, 0.1)',
  transition: 'all 0.3s ease',
  '&:hover': {
    background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.9) 0%, rgba(22, 33, 62, 0.9) 100%)',
  },
}));

const StyledToolbar = styled(Toolbar)({
  display: 'flex',
  justifyContent: 'space-between',
  padding: '1rem 2rem',
  '@media (max-width: 600px)': {
    padding: '1rem',
    flexDirection: 'row',
    gap: '1rem',
  },
});

const Logo = styled(Box)({
  display: 'flex',
  alignItems: 'center',
  gap: '0.5rem',
  cursor: 'pointer',
  textDecoration: 'none',
  transition: 'transform 0.3s ease',
  '&:hover': {
    transform: 'scale(1.05)',
  },
  '& .MuiSvgIcon-root': {
    fontSize: '2.5rem',
    color: '#673ab7',
    filter: 'drop-shadow(0 0 10px rgba(103, 58, 183, 0.3))',
  },
  '& .MuiTypography-root': {
    fontWeight: '900',
    color: 'white',
    background: 'linear-gradient(45deg, #ffffff, #673ab7)',
    WebkitBackgroundClip: 'text',
    WebkitTextFillColor: 'transparent',
  },
});

const NavButton = styled(Button)({
  color: 'white',
  textTransform: 'none',
  fontSize: '1.1rem',
  padding: '0.5rem 1rem',
  borderRadius: '8px',
  transition: 'all 0.3s ease',
  position: 'relative',
  overflow: 'hidden',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: '0',
    height: '0',
    background: 'rgba(255, 255, 255, 0.1)',
    borderRadius: '50%',
    transition: 'width 0.6s ease, height 0.6s ease',
  },
  '&:hover': {
    background: 'rgba(255, 255, 255, 0.1)',
    transform: 'translateY(-2px)',
    '&::before': {
      width: '300px',
      height: '300px',
    },
  },
});

const DrawerContent = styled(Box)({
  width: 250,
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.98) 0%, rgba(22, 33, 62, 0.98) 100%)',
  height: '100%',
  color: 'white',
  backdropFilter: 'blur(10px)',
  borderLeft: '1px solid rgba(255, 255, 255, 0.1)',
});

const StyledListItem = styled(ListItem)({
  margin: '0.5rem',
  borderRadius: '8px',
  transition: 'all 0.3s ease',
  '&:hover': {
    background: 'rgba(103, 58, 183, 0.1)',
    transform: 'translateX(-5px)',
  },
  '& .MuiListItemText-root': {
    '& .MuiTypography-root': {
      fontSize: '1.1rem',
      fontWeight: '500',
    },
  },
});

const navigationItems = [
  { text: 'الرئيسية', path: '/' },
  { text: 'المميزات', path: '/features' },
  { text: 'كيفية الاستخدام', path: '/how-to-use' },
  { text: 'حول', path: '/about' },
  { text: 'اتصل بنا', path: '/contact' },
];

const Header = () => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <DrawerContent>
      <List>
        <ListItem component={RouterLink} to="/" sx={{ justifyContent: 'center', mb: 2, mt: 2 }}>
          <Logo>
            <YouTubeIcon />
            <Typography variant="h6" component="span">
              YTDOWN
            </Typography>
          </Logo>
        </ListItem>
        {navigationItems.map((item) => (
          <StyledListItem
            button
            key={item.text}
            component={RouterLink}
            to={item.path}
            onClick={handleDrawerToggle}
          >
            <ListItemText 
              primary={item.text} 
              sx={{ 
                textAlign: 'center',
                '& .MuiTypography-root': {
                  color: 'white',
                  transition: 'color 0.3s ease',
                  '&:hover': {
                    color: '#673ab7',
                  },
                }
              }}
            />
          </StyledListItem>
        ))}
      </List>
    </DrawerContent>
  );

  return (
    <>
      <StyledAppBar position="fixed">
        <StyledToolbar>
          {isMobile && (
            <IconButton
              color="inherit"
              aria-label="open drawer"
              edge="start"
              onClick={handleDrawerToggle}
              sx={{ 
                mr: 2,
                '&:hover': {
                  background: 'rgba(255, 255, 255, 0.1)',
                  transform: 'rotate(180deg)',
                  transition: 'transform 0.3s ease',
                }
              }}
            >
              <MenuIcon />
            </IconButton>
          )}

          <Logo component={RouterLink} to="/">
            <YouTubeIcon />
            <Typography variant="h5">
              YTDOWN
            </Typography>
          </Logo>

          {!isMobile && (
            <Box sx={{ display: 'flex', gap: '1rem' }}>
              {navigationItems.map((item) => (
                <NavButton
                  key={item.text}
                  component={RouterLink}
                  to={item.path}
                >
                  {item.text}
                </NavButton>
              ))}
            </Box>
          )}
        </StyledToolbar>
      </StyledAppBar>

      <Drawer
        variant="temporary"
        anchor="right"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{
          keepMounted: true,
        }}
        PaperProps={{
          sx: {
            backgroundColor: 'transparent',
            boxShadow: 'none',
          }
        }}
      >
        {drawer}
      </Drawer>

      <Toolbar />
    </>
  );
};

export default Header;
